	 <H3>Nepavyksta patikrinti tinklo nustatymø</H3>
	 
	 
	
<P>Ádiegimo vedliui nepavyko uşmegzti ryğio su spausdintuvu.</P> 

<P>Spustelëkite <b>Taip</b>, jei norite pakeisti spausdintuvo tinklo nustatymus. Vedlys atkurs ryğá su spausdintuvu ir leis jums iğsaugoti arba pakeisti numatytàsias reikğmes.</P>
